    public static int lengthOfLongestSubstring4(String s) {
        int i = 0, j = 0;
        int res = 0;
        Set<Character> set = new HashSet<>();
        while (j < s.length()) {//右边未到字符串末尾
            char cur = s.charAt(j);
            if (set.contains(cur)) {//当前字符已经存在set中（重复了）,移除left指向的左边字符，左边界向右滑动
                set.remove(s.charAt(i));
                i++;
            } else {//未发生重复，j++，右边界向右滑动
                set.add(s.charAt(j));
                res = Math.max(res, j - i + 1);
                j++;
            }
        }
        return res;
    }

    public static int lengthOfLongestSubstring3(String s) {


        if (Objects.isNull(s) || s.equals("")) {
            return 0;
        }
        if (s.trim().equals("") || s.length() == 1) {
            return 1;
        }

        // pwwkew
        int max = 0;
        for (int i = 1; i < s.length(); i++) {
            char c = s.charAt(i);
            int a = s.substring(0, i).lastIndexOf(c);
            if (a == -1) {
                a = 0;
            }
            max = Math.max(max, i - a + 1);
        }
        return max;
    }


    public static int lengthOfLongestSubstring2(String s) {


        if (Objects.isNull(s) || s.equals("")) {
            return 0;
        }
        if (s.trim().equals("") || s.length() == 1) {
            return 1;
        }
        int max = 0;
        for (int i = 0; i < s.length(); i++) {
            for (int j = i + 1; j < s.length(); j++) {
                char c = s.charAt(i);
                char c1 = s.charAt(j);
                if (c == c1) {
                    max = Math.max(max, s.substring(i, j).length());
                    break;
                }
                if (j == s.length() - 1) {
                    max = Math.max(max, j - i + 1);
                }
            }
        }
        return max;
    }

    public static int lengthOfLongestSubstring(String s) {

        int max = 0;
        if (Objects.isNull(s) || s.equals("")) {
            return max;
        }
        if (s.trim().equals("") || s.length() == 1) {
            return 1;
        }
        for (int i = 0; i < s.length(); i++) {
            for (int j = i + 1; j <= s.length(); j++) {
                String substring = s.substring(i, j);
                boolean isDuplicate = false;
                char[] arr = substring.toCharArray();
                for (char ch : arr) {
                    isDuplicate = substring.indexOf(ch) != substring.lastIndexOf(ch);
                    if (isDuplicate) {
                        break;
                    }
                }
                if (!isDuplicate) {
                    max = Math.max(max, substring.length());
                } else {
                    break;
                }
            }
        }
        return max;
    }

